INSERT INTO `event` VALUES (1,'Family Yoga','Do some Yoga!          ',1,0,'Sara Gustafson','10',NULL,'2018-11-27 18:27:11',0),(2,'Toddler Tunes','',0,0,'Bonnie Olsen','0',NULL,'2019-01-15 19:11:43',0),(4,'Love and Logic: School Age','Becoming a Love and Logic Parent is an evidence-based course designed to help you raise self-reliant children. The Instructor for these courses is Michelangelo Lobato Michelangelo is the former Teen Center Director and current Chamisa Elementary Counselor. \r\n\r\nRaise children who are self-confident, motivated, and ready for the real world with this win-win approach to parenting. Your children win because they will learn to solve their own problems. You win because you establish healthy control - without resorting to anger, threats, and nagging or exhaust- ing power struggles. Find specific answers to common child rearing challenges. This class is funded by JJAB.',0,0,'Michelangelo Lobato','0',NULL,'2018-11-01 15:22:38',0),(5,'Social Time','Come chat and hang out.',0,1,'','0',NULL,'2017-03-22 19:55:50',0),(6,'Outdoor Play Day','',0,0,'','0',NULL,'2018-10-26 15:18:15',0),(7,'Family Resource Center','',0,0,'','0',NULL,'2016-10-20 13:35:12',1),(8,'Birth Talk','A community circle for pregnant women and mothers. Our circle is a safe space to learn and share experiences of birth. First Mondays of every month.',0,0,'Erin Tatge and Karen Brown','0',NULL,'2019-01-09 17:14:22',0),(9,'Love and Logic: Teen','In this class, we will discuss specific answers to common challenges that arise in raising teens.',0,0,'Michaelangelo Lobato','0',NULL,'2018-09-04 17:31:34',0),(10,'Love and Logic: Early Childhood','Learn to respond to temper tantrums and set boundaries. We will discuss putting an end to misbehavior in public, smoothing out daily routines and calming sibling battles. There will be time built into class to meet other parents and learn what has and hasn\'t worked for them.',0,0,'Amy Rogers','0',NULL,'2018-11-01 15:21:06',0),(11,'Love and Logic: